import ExpenseItem from './ExpensItem';
// import './Expenses.css';

function Expenses(props) {
  return (

    props.items.map(item=>{
      <div className='bg-black'>
        return <ExpenseItem
            title={item.title}
            amount={item.amount}
            date={item.date}
          />
      </div>
    })

  );

}

export default Expenses;
